			case 'contentActionsOrder': return 'सामग्री क्रियाओं का क्रम';
			case 'contentActionsOrderDesc': return 'अपनी पोस्ट इंटरैक्शन को अपनी पसंद के क्रम में आसानी से पुनर्व्यवस्थित करें।';
			case 'quotes': return 'उद्धरण';
			case 'eventLoading': return 'इवेंट लोड हो रहा है...';
			case 'loadMessages': return 'संदेश लोड करें';
			case 'messagesNotLoaded': return 'संदेश लोड नहीं हुए';
			case 'messagesNotLoadedDesc': return 'स्थानीय रिमोट साइनर के उपयोग के कारण संदेश लोड नहीं किए गए हैं। यदि आप उन्हें लोड करना चाहते हैं, तो नीचे दिए गए बटन पर क्लिक करें।';
			case 'noteLoading': return 'नोट लोड हो रहा है...';
			default: return null;
		}
	}
}

